import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

const name = "Shreyas";
const img = "https://picsum.photos/300/300";
const img1 = "https://picsum.photos/250/300";
const img2 = "https://picsum.photos/300/300";
ReactDOM.render(
  <div>
    <h1 className="title">My name is {name}</h1>
    <div className="images">
    <img alt="img-city" src={img} />
    <img alt="img-city" src={img1} />
    <img alt="img-city" src={img2} />
     </div>

  </div>,
  document.getElementById("root")
);
